class RocketParent extends React.Component {
	render() {
		const rockets = this.props.rockets;
		const rocketsArr = Array;
		console.log(rockets);
		for (let keys in rockets){
			console.log(keys);
			for (let [key, value] of Object.entries(rockets)) {
				console.log(`${key}: ${value}`);
			}
		}

		const array = Array(4).fill('TEST');
		console.log(array);

		return (
			<div>
				{array.map(array2 => (
					<p>{array2}</p>
				))}
			</div>
		);
	};
};

function Rocket() {

};

export default RocketParent;
